const GUASHA_NOT_IN_CART = "GUASHA_NOT_IN_CART";

const ACTION_GUASHA_NOT_IN_CART = () => {
  return {
    type: GUASHA_NOT_IN_CART,
    payload: {
      name: "GuaSha"
    }
  };
};

export default ACTION_GUASHA_NOT_IN_CART;
